import {
  Canvas,
} from '@react-three/fiber'
import { createTheme } from '@mui/material/styles';
import { green, purple } from '@mui/material/colors';
import Container from '@mui/material/Container';

import Info from './components/Info';
import Wire from './components/Wire'

const theme = createTheme({
  palette: {
    primary: {
      main: purple[500],
    },
    secondary: {
      main: green[500],
    },
  },
});

const rootStyle = {
  position: 'absolute',
  display: 'inline-block',
  height: '100vh',
  width: '100vw',
  border: '3px solid black',
  // padding: '10vh',
  align: 'right',
}

const canvasStyle = {
  position: 'absolute',
}

const infoStyle = {
  // position: 'absolute',
  // marginLeft: 'auto',
  // marginRight: '0',
  border: '3px solid red',
  padding: '100px',
  margin: '100px',
  float: 'right',
  width: '100px',
}

function App() {

  return (
    <div style={rootStyle}>
      <Canvas style={canvasStyle}>
        <Wire />
      </Canvas>
      <Info style={infoStyle} />
    </div>
  );
}

export default App;
